import React from "react"
import Header from "./components/Header"
import Footer from "./components/Footer"
import Features from "./components/Features";

class App extends React.Component() {

  render() {
  return (
    <div className="wrapper">
      <Header />
      <Features />
      <Footer />
    </div>
  )
 }
}

export default App;
